import logo from './logo.svg';
import './App.css';
import NavBar from './Componentes/NavBar';


function App() {

  let userColor = "black"
  const styles = { marginTop: "20px", color: userColor};
  let usurario = "Matias"

  return (
    <div className="App">
    <NavBar />
    <div className="header-home"></div>
    <div>
      <h1 ClassName="title">Tienda Spring</h1> 
      <p style={styles}>{usurario}</p>
      <br />
    </div>
    </div>
  );
}

export default App;
